import React, {Component} from 'react';

class TodoList extends Component{

	state = {
		listTitle: "My List #1",

	}

	render(){
		return(
			<div>
				<h2>{this.state.listTitle}</h2>
				<input type="text" size="40" placeholder="Write your next task here..."/>
			</div>
			)
	}
}

export default TodoList;
